import React from "react";
import { useForm, useFieldArray, Controller } from "react-hook-form";
import ReactDOM from "react-dom";

//import "./styles.css";

const Resume_crud_1 = () => {
    const { register, handleSubmit, formState: { errors } } = useForm();
    const onSubmit = data => console.log(data);

    return (
      <form onSubmit={handleSubmit(onSubmit)}>

        <input defaultValue="test" {...register("name")} />
        <input defaultValue="test" {...register("phone")} />
        <input defaultValue="test" {...register("email")} />
        <input defaultValue="test" {...register("street_address")} />
        <input defaultValue="test" {...register("city")} />
        <input defaultValue="test" {...register("province")} />
        <input defaultValue="test" {...register("country")} />

        {errors.exampleRequired && <span>This field is required</span>}

        <input type="submit" />
      </form>
    );
}

export default Resume_crud_1
